import React from 'react';
import {Feature} from '../../components'
import './custom.css';

const Custom = () => {
    return (
        <div className="custom__container section__margin" id="custom">
            <div className="custom__individual__container">
                <Feature />
                <div className="custom__container__heading">
                    <h1 className="gradient-text">Hell World</h1>
                    <p>something here just for the sake of adding some text to test if it goes out of bounds</p>
                </div>
                <div className="custom__container__container">
                <Feature />
                <Feature />
                <Feature />
                </div>
            </div>


        </div>
    );
}

export default Custom;
